        return None
    sign_product = 1
    magnitude_sum = 0
    for num in arr:
        sign_product *= (1 if num > 0 else -1 if num < 0 else 0)
        magnitude_sum += abs(num)
    return magnitude_sum * sign_product

def tri(n):
    if n == 0:
        return [1]
    if n == 1:
        return [1, 3]
    trib = [1, 3]
    for i in range(2, n + 1):
        if i % 2 == 0:
            trib.append(1 + i / 2)
        else:
            trib.append(trib[i - 1] + trib[i - 2] + trib[i - 1])
    return trib

def is_nested(string):
    stack = []
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']' and stack:
            stack.pop()
            if stack:
                return True
    return False

